const actions = {
	setUser ({commit}) {
		let temp_user = {
			id: FBInstant.player.getID(),
			name: FBInstant.player.getName(),
			photo: FBInstant.player.getPhoto(),
		}
		commit('SET_USER', temp_user);
	},

	loadQuiz ({commit}) {

		let signed_player_info = null;
		FBInstant.player.getSignedPlayerInfoAsync(JSON.stringify({msg: "wooooof"}))
			.then((result) => {
				signed_player_info = result;
			})
			.then(() => {
				return axios.post("https://gameoffriends.herokuapp.com/random", {
					"player_id": signed_player_info.getPlayerID(),
                    "signed_request": signed_player_info.getSignature(),
				});
			})
			.then(response => {		
				let payload = jwt.decode(response.data.token, {complete: true}).payload;
				let category_string = payload.question_type;
				let category_index = state.categories.indexOf(category_string);
				let questions = payload.questions;
				let quiz = {
					category_index: category_index,
					questions: questions,
					token: response.data.token
				}
				console.log("new quiz category: " + category_string);
				console.log("new quiz index: " + category_index);
				commit('SET_NEW_QUIZ', quiz);
			})
			.catch(error => {
				console.log("error: " + error);
			});
	},

	loadBackupQuiz ({commit}) {
		let signed_player_info = null;
		FBInstant.player.getSignedPlayerInfoAsync(JSON.stringify({msg: "wooooof"}))
			.then((result) => {
				signed_player_info = result;
			})
			.then(() => {
				return axios.post("https://gameoffriends.herokuapp.com/random", {
					"player_id": signed_player_info.getPlayerID(),
                    "signed_request": signed_player_info.getSignature(),
				});
			})
			.then(response => {
				let payload = jwt.decode(response.data.token, {complete: true}).payload;
				let category_string = payload.question_type;
				let category_index = state.categories.indexOf(category_string);
				let questions = payload.questions;
				let backup = {
					category_index: category_index,
					questions: questions,
					token: response.data.token
				}
				console.log("backup quiz category: " + category_string);
				console.log("backup quiz index: " + category_index);
            	commit('SET_BACKUP_QUIZ', backup);
			})
			.catch(error => {
				console.log("error: " + error);
			});
	},

	loadSingleQuestion ({commit}, replace_index) {
		let signed_player_info = null;
		FBInstant.player.getSignedPlayerInfoAsync(JSON.stringify({msg: "wooooof"}))
			.then((result) => {
				signed_player_info = result;
			})
			.then(() => {
				return axios.post("https://gameoffriends.herokuapp.com/swap", {
                    "player_id": signed_player_info.getPlayerID(),
                    "signed_request": signed_player_info.getSignature(),
                    "token": state.new_quiz_token,
                    "index": replace_index,
                });
			})
			.then(response => {
				let payload = jwt.decode(response.data.token, {complete: true}).payload;
				let question = payload.questions[replace_index];
            	commit('APPEND_NEW_QUESTION', question);
			})
			.catch(error => {
				console.log("error: " + error);
			});
	},

	saveQuiz ({commit}, quiz_answers) {
		let player_id = null;
        let signature = null;
		let post_body = null;
		FBInstant.player.getSignedPlayerInfoAsync()
		.then((result) => {
			player_id = result.getPlayerID();
            signature = result.getSignature();
		})
		.then(() => {
			post_body = {
				"player_id": player_id,
                "signed_request": signature,
				"token": state.new_quiz_token,
				"quiz_answers": quiz_answers,
			};
			//return axios.post("https://gameoffriends.herokuapp.com/quiz", post_body);
		})
		.then(response => {
			state.new_category_index = state.backup_quiz.category_index;
			state.filtered_questions = state.backup_quiz.questions;
			state.new_quiz_token = state.backup_quiz.token;
			console.log("new category index: " + state.new_category_index);
		})
		.catch(error => {
			console.log("error: " + error);
		});
	},

	getUserQuizzes: ({commit}) => {
		let player_id = null;
		let signature = null;
		let user_quizzes = [];
		//commit('GET_USER_QUIZZES', user_quizzes);
		FBInstant.player.getSignedPlayerInfoAsync()
          .then(result => {
              player_id = result.getPlayerID();
              signature = result.getSignature();
          })
		  .then(() => {
			return axios.get("https://gameoffriends.herokuapp.com/quiz", {
				headers: {
					"player_id": player_id,
					"signed_request": signature,
				},
			});
		}).then(response => {
			let quizzes = response.data.player.quizzes;
			for (let i = 0; i < quizzes.length; i++) {
				quizzes[i]["owner"] = state.user;
			}
			user_quizzes = quizzes;
			commit('GET_USER_QUIZZES', user_quizzes);
		})

	},

	getFriendQuizzes: ({commit}) => {	
		let player_id = null;
		let signature = null;
		let friends = null;
		let friends_quizzes = [];
		let friend = null;
		//commit('GET_FRIEND_QUIZZES', friends_quizzes);
		FBInstant.player.getSignedPlayerInfoAsync()
		.then(result => {
			player_id = result.getPlayerID();
			signature = result.getSignature();
		})
		.then(() => {
			FBInstant.player.getConnectedPlayersAsync()
			.then(players => {
				console.log('loadFriends: ');
				friends = players;
			})
			.then(() => {
				for (let i = 0; i < friends.length; i++) {
					friend = friends[i].$1;
					axios.get("https://gameoffriends.herokuapp.com/quiz", {
						headers: {
							"player_id": player_id,
							"signed_request": signature,
							"friend_id": friend.id
						}
					})
					.then(response => {
						let quizzes = response.data.player.quizzes;
						for (let j = 0; j < quizzes.length; j++) {
							let first_name = friend.name.split(' ')[0];
							friend.name = first_name;
							quizzes[j]["owner"] = friend;
							friends_quizzes.push(quizzes[j]);
							if (j + 1 == quizzes.length) {
								commit('GET_FRIEND_QUIZZES', friends_quizzes);
							}
						}
					})
				}
			})
		})	
	},

	takeQuiz: ({commit}, quiz) => {
		commit('TAKE_QUIZ', quiz);
	},

	savePlayerSession: ({commit}, player_session) => {
		commit('UPDATE_LEADERBOARD', player_session);
		commit('SAVE_PLAYER_SESSION', player_session);
	},

}

